        return (
            <div className={"container-fluid"}>
                <NavBar/>
                {this.props.apartmentArray.length !== 0 &&
                <Gallery arrayCiAp={this.props.cityArray}/>
                }
                <Footer/>

            </div>
        );
    }
}

export default PageCity;
